// tela de login

import React from 'react';
import { 
    View, 
    Text, 
    StyleSheet, 
    Image, 
    TextInput, 
    TouchableOpacity
} from 'react-native';

export default function SignIn(){
    return(
        <View style={styles.container}>
            <Image
                style={styles.logo}
                source={require('../../assets/logo.png')} 
                />
            <View style={styles.inputContainer}>
                <TextInput
                    placeholder="Digite seu login"
                    style={styles.input} 
                    placeholderTextColor="#f0f0f0"
                    />

                <TextInput
                    placeholder="Digite sua senha"
                    style={styles.input} 
                    placeholderTextColor="#f0f0f0"
                    />
            </View>    
        </View>
    )
};

const styles = StyleSheet.create({
    container:{
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
        backgroundColor: '#1d1d2e'
    },
    logo:{
        marginBottom: 18
    },
    inputContainer:{
        width: '95%',
        alignItems: 'center',
        justifyContent: 'center',
        paddingVertical: 34,
        paddingHorizontal: 14,
    },
    input:{
        width:'95%',
        height: 40,
        backgroundColor: '#101026',
        marginBottom: 12,
        borderRadius: 4,
        paddingHorizontal: 8,
        color: '#fff',
    }
})
